
public class two_diamention_array {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number[][];
		number=new int[5][6];
		int i,j;
		for(i=0;i<=4;i++)
		{
		for(j=0;j<=5;j++)
		{
		number[i]=Integer.parse.Int(args[i]);
		}
		}
		for(i=0;i<4;i++)
		{
		for(j=0;j<=5;j++)
		{
		System.out.println("2diamentional array is"+number[i][j]);
		}
		}
	}
}



